// HTML button elements
const buttonJS = document.getElementById("js-test");

// button1 click event listener to apply function
buttonJS.addEventListener("click", function () {
  function countdown(n) {
    if (n === 1) {
      return n;
    }
    let answer = countdown(n - 1);
    answer.unshift(n);
    return answer;
  }
  console.log(countdown(5));
});


